import React from 'react'
import ImageGallery from 'react-image-gallery'
import { Transition } from 'react-spring'
import Gallery from './layout/portfolio-gallery'

const pages = [
    style => (
      <animated.div style={{ ...style, background: '#b3FFBD' }}>
              <center>
                <div style={{width: '75%'}}>
                  <ImageGallery items={this.avciso_images} showPlayButton={false} showThumbnails={false}/>
                </div>
              </center>
              <div style={{margin: '10px'}}></div>
              <center>
                <div style={{width: '75%'}}>
                  <ImageGallery items={this.public_ballot_images} showPlayButton={false} showThumbnails={false}/>
                </div>
              </center>
      </animated.div>
    ),
    style => (
      <animated.div style={{ ...style, background: '#B2DBBF' }}>
        <Gallery />
      </animated.div>
    ),
  ]


class Main extends React.Component {
    constructor(props) {
        super(props)
        state = { index: 0 }
        toggle = e =>
          this.setState(state => ({
            index: state.index === 2 ? 0 : state.index + 1,
          }))
        this.avciso_images = [
            {
              original: "api/images/avciso-1.png",
              description: `AvCISO`
            },
            {
              original: "api/images/avciso-2.png",
              description: `AvCISO`
            },
            {
              original: "api/images/avciso-3.png",
              description: `AvCISO`
            }
          ]

          this.public_ballot_images = [
            {
              original: "api/images/publicballot-1.png",
              description: `PublicBallot.org`
            },
            {
              original: "api/images/publicballot-2.png",
              description: `PublicBallot.org`
            },
            {
              original: "api/images/publicballot-3.png",
              description: `PublicBallot.org`
            }
          ]
    }

    render() {
        return (
            <div></div>
        )
    }
}

export default Main;
